import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { UserProvider } from './contexts/UserContext'; // UserContext를 임포트합니다.
import routes from './routes';

function App() {
  return (
    <UserProvider> {/* UserProvider로 모든 Routes를 감싸줍니다. */}
      <BrowserRouter>
        <Routes>
          {routes.map((route, index) => (
            <Route key={index} path={route.path} element={route.element} />
          ))}
        </Routes>
      </BrowserRouter>
    </UserProvider>
  );
}

export default App;
